Thor God of Thunder Vol. 1 The God Butcher (2013) (Digital HC) (Zone-Empire)

Promotional info - &quot;Part of the Marvel NOW! initiative!

Throughout the ages, gods have been vanishing, their mortal worshippers left in chaos. NOW!, Thor follows a trail of blood that threatens to consume his past, present and future. The only hope for these ravaged worlds is for Thor to unravel the gruesome mystery of the God Butcher! In the distant past, Thor follows the bloody wake of murdered gods across the depths of space. In the present, the Thunder God discovers a forgotten cave that echoes with teh cries of tortured gods...and is shocked to find himself among them! And thousands of years from now, the last god-king of a ruined Asgard makes his final stand against the God Butcher's beserker legions. As three Thors from three eras race to stop the God Butcher, the full extent of his vicious scheme takes terrifying shape!&quot;

This is the digital copy of the hardcover by Empire. Thanks to them for all their efforts, please seed and enjoy! :-)

